import React from 'react';
import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={'src\img\foodnetwork.png'} className="App-logo" alt="logo" />
        <p>
          Welcome to FoodNetwork
        </p>
        <ul>
        <li>Anish Karki</li>
        <li>Ashish Rajthala</li>
        <li>Badal Karki</li>
        <li>Nischal Shrestha</li>
        </ul>
      </header>
    </div>
  );
}

export default App;
